"use strict";

function initTimeTracker() {
  $(".timetracker").timetracker(), $(".timetracker").timetracker("start");
}
$(function () {
  $(".owl-carousel").owlCarousel({
    nav: !0,
    margin: 20,
    dots: !1,
    responsiveClass: !0,
    responsive: {
      0: {
        items: 2,
        nav: !0
      },
      600: {
        items: 3,
        nav: !1
      },
      1e3: {
        items: 5,
        nav: !0,
        loop: !1
      }
    }
  });
}), $(function () {
  initTimeTracker();
});